import { ProductCategoryRow } from "./ProductCategoryRow";

export function ProductTable(props) {
    return (
        <>
            <table>
                <tr>
                    <th>Name</th>
                    <th>Price ($)</th>
                </tr>
                <tbody>
                    <ProductCategoryRow
                        filterText={props.filterText}
                        onlyInStock={props.onlyInStock}
                        data={props.data} />
                </tbody>
            </table>
        </>
    )
}
